import React from 'react';

const RadioButton = ({question, onChange, onBlur}) => {
    return (
        <div>
            <p>{question.label}:</p>
            {question.data.map((key, item) => (
                <div>
                <label key={item}>
                    <input type="radio" name={question.key} value={key.value}/>
                    {key.label}
                </label>
                </div>
            ))}
            {question.error && <span>{question.error}</span>}
        </div>
    )
};

export default RadioButton;
